import { Box } from "@mui/material";
import React from "react";
import Features from "./features/Features";
import Header from "./header/Header";
import Main from "./main/Main";
import Templates from "./templates/Templates";
const Home = () => {
    return (
        <Box>
            <Header />
            <Main />
            <Features/>
            <Templates/>
        </Box>
    )
}

export default Home;
